    <script type="text/javascript">
      window.addEventListener("load", () => {
          var icons;
          icons = document.querySelector("script[type='text/icons']");
          icons = icons.innerHTML;
          icons = icons.replace(/x00/g, ' ');
          icons = icons.replace(/(((\r\n)|(\n\r)|[\r\n])\s*?){2,}/g, '\00');
          icons = icons.split(/\00/);
          icons.forEach((element, index, array) => {
              element = element.trim()
              if (!element)
                  return;
              var name = element.match(/^[^\r\n]+/) || "Others";
              var data = element.match(/^\s*data:image[^\r\n]+/gm) || [];
              var root = document.querySelector("main section");
              root.innerHTML += "<h3>" + name + "</h3>";
              data.forEach((element, index, array) => {
                  root.innerHTML += "<div></div>";
                  var node = document.querySelector("main div:last-child");
                  node.style.background = "url('" + element + "') no-repeat center center";
              });
          });
      });
    </script>     
    <style>
      main section div {
        display:inline-block; height:35px; width:35px; margin-right:1em;
      }
      main section span {
        color:#999999; text-decoration:none;  
      }
      main section a {
        color:#CCCCCC; text-decoration:none;  
      }
     
      main label {
        color:#999999;
      }  
      main label span {
        margin-left:0.25em;
        color:#CCCCCC;
      }  
      main label + label {
        margin-left:1em;
      }
      
      main p:last-child a {
        text-decoration:none;
      }
      main p:last-child a:before {
        text-decoration:none;    
        content:attr(text);
      }
      main p:last-child a:after {
        color:#FFFFFF;
        content:attr(title);
      }
    </style>      
  </head>
  <body>
    <main>
      <h1>Overview of icons</h1>
      <h2>A selection of standard icons for the user interface.</h2>
      <h3>Creation guide</h3>
      <p>
        <label>Type:<span>iOS</span></label>
        <label>Format:<span>PNG</span></label>
        <label>Size:<span>35px x 35px / 25px x 25px</span> for inlay</label>
        <label>Color:<span>#FFAA44</span></label>
      </p>

    </main>
